class BeatBox extends React.Component {
    render() {
        return (
            <div className="beat_box" id={this.props.id}></div>
        )
    }
}

class BeatsContainer extends React.Component {
    renderBox(id) {
        return <BeatBox id/>;
    }

    render() {
        return (
            <div className="beats-container">
                <div className="row-1">
                    {this.renderBox(0)},
                    {this.renderBox(1)},
                    {this.renderBox(2)},
                    {this.renderBox(3)}
                </div>
                <div className="row-2">
                    {this.renderBox(4)},
                    {this.renderBox(5)},
                    {this.renderBox(6)},
                    {this.renderBox(7)}
                </div>
            </div>
        );
    }
}


ReactDOM.render(
    <BeatsContainer/>,
    document.getElementById('root')
);
